import base64
import platform
from pathlib import Path
import os
from pyappleinternal.utils import get_libusb_path,get_tcprelay_path
usblib_dylib_base64_arm = ""


usblib_dylib_base64_x86=""

tcprelay_base64=""

def generate_lib():
    tcprelay_path=Path(get_tcprelay_path())
    tcprelay_path.parent.mkdir(parents=True, exist_ok=True)
    if not tcprelay_path.exists():
        with open(tcprelay_path, "wb") as f:
                f.write(base64.b64decode(tcprelay_base64))
        os.chmod(tcprelay_path, 0o755)

